import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Router } from '@angular/router';

interface RegisterUser {
  firstname: string;
  lastname: string;
  email: string;
  password: string;
  phone: string;
  validatePassword: string;
  birthdate: string;
}

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  // Variables para almacenar los datos del formulario
  firstname: string = '';
  lastname: string = '';
  email: string = '';
  password: string = '';
  phone: string = '';
  validatePassword: string = '';
  birthdate: string = '';

  showAlert: boolean = false; // Variable para controlar la visibilidad del texto de alerta

  constructor(private http: HttpClient, private router: Router) { }

  // Función para enviar la solicitud de registro
  async registerUser() {
    if (!this.validateForm()) {
      return; // Si hay campos vacíos o las contraseñas no coinciden, detener el registro
    }

    const user: RegisterUser = {
      firstname: this.firstname,
      lastname: this.lastname,
      email: this.email,
      password: this.password,
      phone: this.phone,
      validatePassword: this.validatePassword,
      birthdate: this.birthdate
    };

    try {
      await this.http.post<any>('http://localhost:3000/api/register', user).toPromise();
      alert('Cuenta creada exitosamente!');
      this.router.navigate(['/login']);
    } catch (error: any) {
      console.error('Error al registrar usuario:', error);
      alert(error.error.message);
      // Aquí puedes mostrar un mensaje de error al usuario
    }
  }

  // Función para validar el formulario antes de enviarlo
  validateForm(): boolean {
    if (
      this.firstname.trim() === '' ||
      this.lastname.trim() === '' ||
      this.email.trim() === '' ||
      this.password.trim() === '' ||
      this.validatePassword.trim() === '' ||
      this.phone.trim() === '' ||
      this.birthdate.trim() === ''
    ) {
      alert('Todos los campos son obligatorios');
      return false;
    }

    if (this.password !== this.validatePassword) {
      alert('Las contraseñas no coinciden');
      return false;
    }

    return true;
  }
}
<div class="register-container">
  <div class="image-overlay"></div> <!-- Capa de fondo degradado -->
  <div class="center-form">
    <div class="image-container">
      <img class="image-svg" src="../../assets/logoChek.svg" alt="Imagen SVG"> <!-- Imagen SVG encima del formulario -->
    </div>
    <label class="register-label">Register</label> <!-- Label "Register" con letras blancas -->
    <form>
      <div class="form-field">
        <input type="text" placeholder="Nombre" name="firstname" id="firstname" [(ngModel)]="firstname">
      </div>
      <div class="form-field">
        <input type="text" placeholder="Apellido" name="lastname" id="lastname" [(ngModel)]="lastname">
      </div>
      <div class="form-field">
        <input type="tel" placeholder="Número de celular" name="phone" id="phone" [(ngModel)]="phone">
      </div>
      <div class="form-field">
        <input type="email" placeholder="Correo electrónico" name="email" id="email" [(ngModel)]="email">
      </div>
      <div class="form-field">
        <input type="password" placeholder="Clave nueva" name="password" id="password" [(ngModel)]="password">
      </div>
      <div class="form-field">
        <input type="password" placeholder="Confirmar clave nueva" name="validatePassword" [(ngModel)]="validatePassword">
      </div>
      <div class="form-field">
        <input type="text" placeholder="Fecha de nacimiento" name="birthdate" [(ngModel)]="birthdate">
      </div>
      <div class="center-button"> <!-- Contenedor del botón centrado -->
        <button class="button-register" (click)="registerUser()">Registrarse</button>
      </div>
      <div class="center-button"> <!-- Contenedor del botón centrado -->
        <button class="button-register" routerLink="/login">Ingresar</button>
      </div>
    </form>
  </div>
</div>
